import { Container,makeStyles,Typography } from '@material-ui/core';
import { Home,People,List,Image,PlayCircleOutline,Settings,ExitToApp,LocalMall } from '@material-ui/icons';
import { Link,useHistory,useRouteMatch } from 'react-router-dom';
import {useCookies} from 'react-cookie';

const useStyles = makeStyles((theme) => ({
  container: {
    height: "100vh",
    color: "#555",
    position :"sticky",
    top: 0,
    paddingTop: theme.spacing(7),
    backgroundColor: "white",
    border: "1px solid #ece7e7",
  },
  item:{
    display: "flex",
    alignItems: "center",
    marginTop: theme.spacing(2),
    [theme.breakpoints.up("sm")]:{
      marginTop: theme.spacing(3),
      cursor: "pointer",
    },
  },
  icon:{
    marginRight: theme.spacing(1),
    [theme.breakpoints.up("sm")]:{
      fontSize: "18px",
    },
  },

  text:{
    fontWeight: 500,
    [theme.breakpoints.down("xs")]:{
      display: "none",
    },
  },
  link:{
    display: "flex",
    textDecoration: "none",
    color: "#555",
  },
}));
export default function LeftBart() {
  const classes = useStyles();
  const [removeToken] = useCookies(['mytoken'])
  let history = useHistory();
  let { path, url } = useRouteMatch();

  const logoutMenu = () => {
    removeToken(['mytoken'])
    //history.push('/')

  };

  return (
    <Container className={classes.container}>
        <div className={classes.item}>
          <Link exact to="/Home" className={classes.link}>
            <Home className={classes.icon}/>
            <Typography className={classes.text}>
                Home
            </Typography>
          </Link>
        </div>

        <div className={classes.item}>
          <Link exact to={`${url}/profile`} className={classes.link}>
            <People className={classes.icon}/>
            <Typography className={classes.text}>
                Friends
            </Typography>
          </Link>
        </div>

        <div className={classes.item}>
          <List className={classes.icon}/>
          <Typography className={classes.text}>
            Lists
          </Typography>
        </div>

        <div className={classes.item}>
          <Image className={classes.icon}/>
          <Typography className={classes.text}>
            Images
          </Typography>
        </div>

        <div className={classes.item}>
          <PlayCircleOutline className={classes.icon}/>
          <Typography className={classes.text}>
            Videos
          </Typography>
        </div>

        <div className={classes.item}>
          <LocalMall className={classes.icon}/>
          <Typography className={classes.text}>
            Shop
          </Typography>
        </div>

        <div className={classes.item}>
          <Link exact to={`${url}/settings`} className={classes.link}>
            <Settings className={classes.icon}/>
            <Typography className={classes.text}>
              Settings
            </Typography>
          </Link>
        </div>

        <div className={classes.item}>
          <Link className={classes.link} onClick = {logoutMenu}>
            <ExitToApp className={classes.icon}/>
            <Typography className={classes.text}>
              Logout
            </Typography>
          </Link>
        </div>
    </Container>
  );
}
